// Modules //
import React from 'react';
import axios from 'axios';
import Fade from 'react-reveal/Fade';

// Style //
import { Container, Col, Row, Card } from 'react-bootstrap';
import './LanguesCoord.scss';

class Main extends React.Component {

  render() {
    return (
      <div className="div_diplomes">
        <Container>

            <Row>
            <Fade cascade>
            <Col xs={12}>
                <h2 className="h2_diplomes">Langues Parlées</h2>
                <Card className="border-0">
                    <Card.Body className="">
                        <Card.Title>Anglais</Card.Title>
                        <Card.Subtitle>Samsung Campus, Saint-Ouen</Card.Subtitle>
                        <Card.Title>Japonais</Card.Title>
                        <Card.Subtitle>Samsung Campus, Saint-Ouen</Card.Subtitle>
                    </Card.Body>
                </Card>
            </Col>
            <Col xs={24}>
                <h2 className="h2_diplomes">Coordonnées</h2>
                <Card className="border-0">
                    <Card.Body className="">
                        <Card.Title>Anglais</Card.Title>
                        <Card.Subtitle>Samsung Campus, Saint-Ouen</Card.Subtitle>
                        <Card.Title>Japonais</Card.Title>
                        <Card.Subtitle>Samsung Campus, Saint-Ouen</Card.Subtitle>
                    </Card.Body>
                </Card>
            </Col>
            </Fade>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Main;
